const FooterTienda = () => {
  return (
    <>
      <footer className="footer pt-5 pb-5 mt-auto bg-dark footer-dark">
        <div className="container">
          <div className="row">
            <div className="col-md-12">
              <div className="footer-brand">ShopAR</div>
              <div className="mb-0">Construyendo el futuro</div>
            </div>
          </div>
        </div>
      </footer>
    </>
  );
};

export default FooterTienda;
